import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return(
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
    <button className="navbar-toggler second-button" type="button" data-toggle="collapse" data-target="#navbarSupportedContent23"
    aria-controls="navbarSupportedContent23" aria-expanded="false" aria-label="Toggle navigation">
    <div className="nav-icon"><span></span><span></span><span></span><span></span></div>
  </button>

  <div class="collapse navbar-collapse" id="navbarSupportedContent">
    <Link className="nav-link text-uppercase" to={'/'}>Home</Link>
  </div>
  </nav>
  )
}

export default NavBar;
